import React from "react";
import UserRow from "./UserRow";
import { UserLogged } from "./model/model/types";

interface UsersLogged {
    usersLogged: UserLogged[];
}

const UserTable: React.FC<UsersLogged> = ({ usersLogged }) => {
    return (
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
            <thead>
            <tr style={{backgroundColor: "#f2f2f2", textAlign: "left"}}>
                <td>
                    {/* Assuming profilePhoto is a URL to the image */}
                    <img src={profilePhoto} alt={username} style={{width: "50px", height: "50px"}}/>
                </td>
                <td>{username}</td>
                <td>{name}</td>
                <td>{new Date(timeWhenLogged).toLocaleString()}</td>
            </tr>
            </thead>
            <tbody>
            {usersLogged.map((userLogged, index) => (
                <UserRow key={index} {...userLogged} />
            ))}
            </tbody>
        </table>
    );
};

export default UserTable;
